import React, { Component } from "react";
import "./App.css";

class App extends Component {
  render() {
    return (
      <div id="wrapper">
        <div id="container">
          <ul class="songs blur">
            <li>
              <img
                src="http://enwaara.se/codepen/post-malone.jpg"
                alt="posty"
              />
              <h2>Post Malone</h2>
              <p>
                <i class="fas fa-compact-disc" />I Fall Apart
              </p>
            </li>
          </ul>

          <div class="time blur">
            <p>0:00</p>
            <p>3:43</p>
            <div id="time" />
          </div>
        </div>
      </div>
    );
  }
}

export default App;
